import React, { useState, useEffect } from 'react';
import Table from '../Components/CustomTable';

const MyTable = () => {

    const [data, setData] = useState([]);
  
    useEffect(() => {
      fetch('https://fakestoreapi.com/users')
        .then(response => response.json())
        .then(data => setData(data))
    }, []);
  
    const columns = React.useMemo(
        () => [    {      Header: 'Username',      accessor: 'username',    },    {      Header: 'Full Name',      accessor: 'name',    },    {      Header: 'Email',      accessor: 'email',    },    {      Header: 'Phone',      accessor: 'phone',    },    {      Header: 'Website',      accessor: 'website',    },  ],
        []
      );
      

    console.log(data);
    
    const handleRowClick = (row) => {
      console.log('Clicked row:', row.original);
    };
  
    return (
      <div>
        <Table title="Customer List" data={data} columns={columns} onRowClick={handleRowClick} />
      </div>
    );
  };
  
  export default MyTable;
